$_MODULE['<{kiala}prestashop>kiala_9b4be0084a0657f91204a785f10b7cb8'] = 'The Kiala technological platform automates all transportation and delivery activities (Track and trace, automatic notification upon parcel arrival, reminder, cash-on-delivery, …';
