$_MODULE['<{kiala}prestashop>point-1-4_54302d88d8c0c0cab9664c7f47171971'] = 'When your package is delivered you are instantly notified by e-mail, text or phone recording. Using the Kiala website you can follow the whereabouts of your package at each step of the shipping process.';
